// SPDX-License-Identifier: MIT

pragma solidity >=0.8.2 <0.9.0;

struct Kiralik {
    address kiraci;
    string sehir;
    string ilce; 
    string mahalle;
    string sokak;
    uint256 binaNo;
    uint256 daireNo;
    address sahip;
}

struct Sozlesme {
    Kiralik kiralik;
    string baslangicTarihi;
    string bitisTarihi; 
}

contract KiralamaSozlesmesi {

    address public kontratSahibi;
    uint256 public kiralikSayisi;

    Kiralik[] public kiralikYerler;
    Sozlesme[] public sozlesmeler;

    event Kiralama(address indexed kiraci, address indexed sahip, string sehir, string ilce, string mahalle, string sokak, uint256 binaNo, uint256 daireNo, string baslangicTarihi, string bitisTarihi);
    event Sonlandir(address indexed kiraci, address indexed sahip, string sehir, string ilce, string mahalle, string sokak, uint256 binaNo, uint256 daireNo);

    modifier sadeceKontratSahibi() {
        require(msg.sender == kontratSahibi, "Only contract owner");
        _;
    }

    constructor() {
        kontratSahibi = msg.sender;
        kiralikSayisi = 0;
    }

    function kirala(
        address _kiraci,
        string memory _sehir,
        string memory _ilce,
        string memory _mahalle,
        string memory _sokak,
        uint256 _binaNo,
        uint256 _daireNo,
        address _sahip,
        string memory _baslangicTarihi,
        string memory _bitisTarihi
    ) public sadeceKontratSahibi {
        require(_kiraci != address(0), "Gecersiz kiraci adresi");
        require(_sahip != address(0), "Gecersiz sahip adresi"); 

        Kiralik memory kiralik = Kiralik(_kiraci, _sehir, _ilce, _mahalle, _sokak, _binaNo, _daireNo, _sahip);
        kiralikYerler.push(kiralik); 

        Sozlesme memory sozlesme = Sozlesme(kiralik, _baslangicTarihi, _bitisTarihi);
        sozlesmeler.push(sozlesme); 

        kiralikSayisi++; 

        emit Kiralama(_kiraci, _sahip, _sehir, _ilce, _mahalle, _sokak, _binaNo, _daireNo, _baslangicTarihi, _bitisTarihi);
    }

    function sonlandir(address _kiraci, string memory _sehir, string memory _ilce, string memory _mahalle, string memory _sokak, uint256 _binaNo, uint256 _daireNo, address _sahip) public sadeceKontratSahibi {
        require(_kiraci != address(0), "Gecersiz kiraci adresi"); 
        require(_sahip != address(0), "Gecersiz sahip adresi");

        bool bulundu = false;
        uint256 indeks = 0; 

        for (uint256 i = 0; i < kiralikSayisi; i++) {
            Kiralik memory kiralik = kiralikYerler[i];
            if (
                kiralik.kiraci == _kiraci &&
                keccak256(abi.encodePacked(kiralik.sehir)) == keccak256(abi.encodePacked(_sehir)) &&
                keccak256(abi.encodePacked(kiralik.ilce)) == keccak256(abi.encodePacked(_ilce)) &&
                keccak256(abi.encodePacked(kiralik.mahalle)) == keccak256(abi.encodePacked(_mahalle)) &&
                keccak256(abi.encodePacked(kiralik.sokak)) == keccak256(abi.encodePacked(_sokak)) &&
                kiralik.binaNo == _binaNo &&
                kiralik.daireNo == _daireNo &&
                kiralik.sahip == _sahip
            ) {
                bulundu = true;
                indeks = i; 
                break;
            }
        }

        require(bulundu, "Kiralama bulunamadi");

        delete kiralikYerler[indeks];
        delete sozlesmeler[indeks];

        kiralikSayisi--;

        emit Sonlandir(_kiraci, _sahip, _sehir, _ilce, _mahalle, _sokak, _binaNo, _daireNo);
    }

    function hataBildir(address _kiraci, string memory _sehir, string memory _ilce, string memory _mahalle, string memory _sokak, uint256 _binaNo, uint256 _daireNo, address _sahip) public view {
        require(msg.sender == _kiraci, "Only contract owner");
        require(_kiraci != address(0), "Gecersiz kiraci adresi"); 
        require(_sahip != address(0), "Gecersiz sahip adresi"); 
        bool bulundu = false;

        for (uint256 i = 0; i < kiralikSayisi; i++) {
            Kiralik memory kiralik = kiralikYerler[i];
            if (
                kiralik.kiraci == _kiraci &&
                keccak256(abi.encodePacked(kiralik.sehir)) == keccak256(abi.encodePacked(_sehir)) &&
                keccak256(abi.encodePacked(kiralik.ilce)) == keccak256(abi.encodePacked(_ilce)) &&
                keccak256(abi.encodePacked(kiralik.mahalle)) == keccak256(abi.encodePacked(_mahalle)) &&
                keccak256(abi.encodePacked(kiralik.sokak)) == keccak256(abi.encodePacked(_sokak)) &&
                kiralik.binaNo == _binaNo &&
                kiralik.daireNo == _daireNo &&
                kiralik.sahip == _sahip
            ) {
                bulundu = true;
                break;
            }
        }

        require(bulundu, "Kiralama bulunamadi");
    }
}

